import React from 'react';
import fifty from '../resources/50.png';

export default function Home() {
    return (
        <div className="Home">
            <h1 style={{textAlign:'left', paddingLeft:'1%', color:'#993366', width: "658px", height: "8px"}}>Welcome to Mallard and Claret Fly Fishers Club Inc</h1>
            <img src={fifty} alt="50" style={{padding: '1%', width:'2%'}} />
        </div>
    )
}
